import AreasPanel from './AreasPanel.jsx';
import AreaMap from './AreaMap.jsx';
import ErrorBanner from './ErrorBanner.jsx';
import StatusBadge from './StatusBadge.jsx';
import ShadingCard from './ShadingCard.jsx';
import SensorDrawer from './SensorDrawer.jsx';

export default function Dashboard({
  // אזורים
  areas = [],
  areaId,
  onPickArea,

  // סנסורים
  sensors = [],
  selectedSensor,
  selectedValues,

  // סטטוס כללי
  loading,
  error,

  // מצב מנהל
  adminMode,
  setAdminMode,

  // פעולות על אזורים
  onAddArea,
  onEditArea,
  onDeleteArea,

  // פעולות על סנסורים
  onAddSensor,
  onAddShade,
  onDeleteSensorFromDrawer,
  onToggleActiveFromDrawer,
  onMoveSensor,

  // דרואר
  onCloseDrawer,

  // מפה
  onMapSizeDetected,
  onPlaceRequest,

  // הצללה
  onShadeAutoApply,

  // בחירת סנסור למטרת דרואר
  onSelectSensor,

  // פתיחת מודל עריכה מתוך הדרואר
  onEditSensorFromDrawer,
}) {
  const area = (areas || []).find(a => a.id === areaId) || null;

  return (
    <div className="app">
      {/* צד שמאל */}
      <aside className="sidebar">
        <div className="hbar">
          <h1 className="title">מערכת ניהול סנסורים וקמפוס</h1>
          <button
            className={`iconbtn ${adminMode ? 'green' : 'red'}`}
            title={adminMode ? 'מצב מנהל פעיל' : 'הפעל מצב מנהל'}
            onClick={() => setAdminMode(v => !v)}
          >
            ⚙
          </button>
        </div>
        <small className="sub">הוספת אזורים וסנסורים, תמונות מפה וגרירת נקודות</small>

        <div className="toolbar" style={{ margin: '10px 0 0' }}>
          <button className="btn" onClick={onAddArea}>אזור חדש</button>
          <button className="btn" onClick={onEditArea} disabled={!area}>ערוך אזור</button>
          <button className="btn" onClick={onDeleteArea} disabled={!area}>מחק אזור</button>
        </div>

        {/* רשימת אזורים */}
        <AreasPanel
          areas={areas || []}
          activeAreaId={areaId}         /* תאימות לגרסה אחת */
          currentAreaId={areaId}        /* ותאימות לאחרת */
          onPickArea={onPickArea}
        />

        {/* מערכת הצללה לאזור שנבחר */}
        <ShadingCard
          areaId={areaId}
          sensors={sensors || []}
          adminMode={adminMode}
          onAutoApply={onShadeAutoApply}
        />

        {/* כפתורי הוספה - רק במצב מנהל */}
        {adminMode && (
          <div className="section toolbar">
            <button className="btn" onClick={onAddSensor} disabled={!area}>הוסף סנסור במפה</button>
            <button className="btn" onClick={onAddShade} disabled={!area}>הוסף מערכת הצללה</button>
          </div>
        )}
      </aside>

      {/* מרכז - מפה */}
      <main className="main">
        <div className="header">
          <div className="hbar">
            <div className="title">מפה</div>
            <StatusBadge ok text={`${sensors?.length || 0} סנסורים`} />
          </div>
          {loading ? <div className="sub">טוען...</div> : null}
        </div>

        <ErrorBanner message={error} />

        <AreaMap
          area={area}
          sensors={sensors || []}
          adminMode={adminMode}
          onMoveSensor={onMoveSensor}
          // חשוב - לחיצה על סנסור פותחת דרואר בלבד
          onSelect={onSelectSensor}
          onSelectSensor={onSelectSensor} // אם הקומפוננטה שלך משתמשת בשם הזה
          onMapSize={onMapSizeDetected}
          onPlaceRequest={onPlaceRequest}
        />
      </main>

      {/* דרואר סנסור */}
      <SensorDrawer
        sensor={selectedSensor}
        values={selectedValues}
        onClose={onCloseDrawer}
        onEdit={onEditSensorFromDrawer}            // עריכה רק מכאן
        onDelete={onDeleteSensorFromDrawer}
        onToggleActive={onToggleActiveFromDrawer}
      />
    </div>
  );
}
